%[text] # Animator
%[text] The Animator app builds up the frames for a GIF animation by varying a parameter in your code. 
%[text] Imagine code like this.
%[text] ![](text:image:1759)
%[text] Change the variable `azimuth` with the Animator app, and you'll get a GIF like this.
%[text] ![](text:image:3db0)
%[text] ## Installating the App
%[text] You can try creating the example above with the `logo_demo` example.
%[text] `>> edit logo_demo`
%[text] `>> animator`
%[text] Then try following the directions in the image below.
%[text] ![](text:image:7d3c)
%[text] Some usage notes:
%[text] 1. You need to be in a writeable directory, since you'll be writing out a GIF file.
%[text] 2. The line you modify must be a simple assignment statement like "angle = 45" or "x = 12". \

